const initialState = {
    
}

const wizardReducer = (state = initialState, action) => {

    
    switch (action.type) {
        case 'GET_FB_DATA' :
            return {
                ...state,
                fbData : action.payload,
            }
     
        default:
            return state;
    }
}

export default wizardReducer;
